    const [modalVisible, setModalVisible] = useState(true)
    return(
        <View style={{backgroundColor: "white"}}>
            <Modal
                animationType="slide"
                visible={modalVisible}
                transparent={true}
                onRequestClose={() => setModalVisible(false)}
            >
                <View style={{backgroundColor: "white"}}>jhgcvbjuhygv</View>
            </Modal>
        </View>
    )
}

